class ReassemblerTest(unittest.TestCase):
    def test_reassemble(self):
        for order in orderings:
            current_packets = [packets[i] for i in order]
            self.process_packets(current_packets)

    def process_packets(self, current_packets):
        reassembler = IPReassembler()
        for p in current_packets:
            eth = EthernetII.from_buffer(p)
            status = reassembler.process(eth)
            assert_not_equal(status, IPReassembler.Status.NOT_FRAGMENTED)
            if status == IPReassembler.Status.REASSEMBLED:
                eth.rfind_pdu(UDP)
                raw = eth.rfind_pdu(RAW)
                eq_(len(raw.payload), 15000)
